import React from "react";

const NotFound = () => {
  return (
    <div>
      <h1>404 Not Found</h1>
      <p>The page you are looking for does not exist. </p>
      <a href="http://localhost:3000/">Return to home page</a>
    </div>
  );
};

export default NotFound;
